var modUtils = {
  setTimeout: function(f,time){
    this.jobs.push({f: f,time: game.step+time});
  },
  jobs: [],
  tick: function(){
    var t = game.step;
    for (var i=this.jobs.length-1;i>=0;i--){
      var job = this.jobs[i];
      if (t>=job.time){
        try {
          job.f();
        }
        catch (err){
        }
        this.jobs.splice(i,1);
      }
    }
  }
};

