function sqrDist(x, y){
  return x*x+y*y;
}

function distance(x, y){
  return Math.sqrt(x*x+y*y);
}

function dist2points(x, y, z, t){
  return Math.sqrt((z-x)**2+(t-y)**2);
}

var ms = 150;
function shortestPath(x1, y1, x2, y2, wrapV = true, wrapH = true){
  var shortestDist = 10000;
  var map_size = ms*5;
  var coords = [];
  var xx = x2-x1;
  var yy = y2-y1;
  if (!wrapH&&!wrapV) return [xx, yy];
  coords.push(xx, yy);
  var shortest = [xx, yy];
  if (wrapH){
    xx = x2+map_size*2-x1;
    yy = y2-y1;
    coords.push(xx, yy);
    xx = x2-map_size*2-x1;
    yy = y2-y1;
    coords.push(xx, yy);
  }
  if (wrapV){
    xx = x2-x1;
    yy = y2+map_size*2-y1;
    coords.push(xx, yy);
    xx = x2-x1;
    yy = y2-map_size*2-y1;
    coords.push(xx, yy);
  }
  if (wrapV&&wrapH){
    xx = x2+map_size*2-x1;
    yy = y2+map_size*2-y1;
    coords.push(xx, yy);
    xx = x2+map_size*2-x1;
    yy = y2-map_size*2-y1;
    coords.push(xx, yy);
    xx = x2-map_size*2-x1;
    yy = y2+map_size*2-y1;
    coords.push(xx, yy);
    xx = x2-map_size*2-x1;
    yy = y2-map_size*2-y1;
    coords.push(xx, yy);
  }
  for (var i = 0; i<9; i++){
    var dist = sqrDist(coords[i*2], coords[i*2+1]);
    if(dist<shortestDist){
      shortestDist = dist;
      shortest = [coords[i*2], coords[i*2+1]];
    }
  }
  return shortest;
}

function drawdirectionmarker(ship, x, y, wrapV, wrapH, id, color, label){
  var sp = shortestPath(ship.x, ship.y, x, y, wrapV, wrapH);
  var dist = distance(sp[0],sp[1]);
  var x1 = sp[0]/dist;
  var y1 = sp[1]/dist;
  sendUI(ship, {
    id: id,
    position:[47+x1*30,49-y1*30,6*1.5,2*1.5],
    clickable: false,
    visible: true,
    components: [
      {type:"box",position:[40,30,20,40],fill:color,stroke:def_clr,width:2},
      {type:"text",position:[((x<0-50)?0:75),0,25,100],value:label,color:def_clr}
    ]
  });
}
